g2:c.PROCEDURE.g2:a.TEXT:
t-g2-get-item-layer-position-test(node: class benchmark-node )
error-obj:class error;
ITEM,I: class item;
POS,POS1,POS2,POS3,POS4: integer;
begin

// 1)  invalid item.
    begin
        POS = call g2-get-item-layer-position(non-existant-item);
        call fail(node, "Called a non-existant item and the result was [POS]");
    end
    on error (error-obj)
    end;
    

// 2) item created dynamically.
    create a g2-array I;
    POS = call g2-get-item-layer-position(I);
    if POS /= 0 then
        begin    
        call fail(node, "Called a non-existant item and the result was [POS]");
        return;
    end;
  
// 3) Lone item ( can be at any layer position ). WS_3 is the workspace
//    item item3_1.
    POS= call g2-get-item-layer-position(item3_1);
    if  POS  <  0   then
         begin
         call fail(node, "Expected a Position of item greater than 0 but the result was [POS]");
          return;
    end;

// 4) two items WS_4 is the workspace
//    items are item4_1 and item4_2. item4_1 is placed above item4_2.

    POS1= call g2-get-item-layer-position(item4_1);
    POS2= call g2-get-item-layer-position(item4_2);

    if  POS1  >  POS2   then
        begin
        call fail(node, "Expected the position of item4_1 [POS1] to be smaller than item4_2 [POS2], 
        but the opposite was true");
        return;
    end;


// 5) two items WS_5 is the workspace
//    items are item5_1 and item5_2.  item5_1 is placed below item5_2.

    POS1 = call g2-get-item-layer-position(item5_1);
    POS2 = call g2-get-item-layer-position(item5_2);

    if  POS2  >  POS1   then
        begin
        call fail(node, "Expected the position of item5_2([POS2]) to be lesser than item5_1([POS1]), 
        but the opposite was the result");
        return;
    end;




// 6) four items WS_6 is the workspace
//    items are item6_1, item6_2, item6_3 and item6_4. 

    POS1= call g2-get-item-layer-position(item6_1);
    POS2= call g2-get-item-layer-position(item6_2);
    POS3= call g2-get-item-layer-position(item6_3);
    POS4= call g2-get-item-layer-position(item6_4);

    if  POS4  <  POS3  or
        POS3  <  POS2  or
        POS2  <  POS1  then  
        begin
        call fail(node, "Expected the order to be item6_1 ([POS1]) < item6_2 ([POS2]) < item6_3 ([POS3]) < item6_4 ([POS4]), 
        but the order was not maintained");
        return;
    end;



// 7) four items WS_7 is the workspace
//    items are item7_1, item7_2, item7_3 and item7_4 ( stacked one upon the other). 

    call g2-lift-item-to-top(item7_4);
    call g2-lift-item-to-top(item7_3);
    call g2-lift-item-to-top(item7_2);
    call g2-lift-item-to-top(item7_1);

    POS1= call g2-get-item-layer-position(item7_1);
    POS2= call g2-get-item-layer-position(item7_2);
    POS3= call g2-get-item-layer-position(item7_3);
    POS4= call g2-get-item-layer-position(item7_4);

    if  POS4  <  POS3  or
        POS3  <  POS2  or
        POS2  <  POS1  then  
        begin
        call fail(node, "Expected the order to be item7_1 ([POS1]) < item7_2 ([POS2]) < item7_3 ([POS3]) < item7_4 ([POS4]), 
        but the order was not maintained");
        return;
    end;


// rearrangement 1. ( lifting item7_3 to top).
     call g2-lift-item-to-top(item7_3);

    POS1= call g2-get-item-layer-position(item7_1);
    POS2= call g2-get-item-layer-position(item7_2);
    POS3= call g2-get-item-layer-position(item7_3);
    POS4= call g2-get-item-layer-position(item7_4);

    if  POS4  <  POS2  or
        POS2  <  POS1  or
        POS1  <  POS3  then  
        begin
        call fail(node, "Expected the order to be item7_3 ([POS3]) < item7_1 ([POS1]) < item7_2 ([POS2]) < item7_4 ([POS4]), 
        but the order was not maintained");
        return;
    end;



// rearrangement 2. ( dropping item7_2 to bottom).
    call g2-drop-item-to-bottom(item7_2);

    POS1= call g2-get-item-layer-position(item7_1);
    POS2= call g2-get-item-layer-position(item7_2);
    POS3= call g2-get-item-layer-position(item7_3);
    POS4= call g2-get-item-layer-position(item7_4);

    if  POS2  <  POS4  or
        POS4  <  POS1  or
        POS1  <  POS3  then  
        begin
        call fail(node, "Expected the order to be item7_3 ([POS3]) < item7_1 ([POS1]) < item7_4 ([POS4]) < item7_2 ([POS2]), 
        but the order was not maintained");
        return;
    end;

call pass(node);
end
